import React from 'react'
import './bottomBar.css'
import Home  from '../../utils/images/home.svg';
import Cinema from '../../utils/images/cinema.svg';
import Offers from '../../utils/images/offer.svg';
import { Link } from 'react-router-dom';

const BottomBar = () => {
  return (
    <main className='main_bottom_bar'>
        <section className='d-flex justify-content-center align-items-center'>
            <Link to='/' className='d-flex flex-col justify-content-center align-items-center'>
                <img src={Home} alt="home" /> 
                <span>Home</span>
            </Link>
        </section>  
    </main>
  )
}

export default BottomBar
